import React from 'react';

const GalleryPage = () => {
  return (
    <div className="gallery-page">
      <div className="page-header">
        <div className="container">
          <h1>Gallery</h1>
          <p>Explore our school through photos and videos</p>
        </div>
      </div>
      <div className="container">
        <h2>Gallery Coming Soon!</h2>
        <p>We're preparing a beautiful gallery for you to explore.</p>
      </div>
    </div>
  );
};

export default GalleryPage;
